import React from 'react';

const UsersView = ({ users, setCurrentUser }) => (
  <ul>
    {users.map(({ id, name, image, statusText }) => (
      <li id={id} key={id} data-se onClick={setCurrentUser}>
        <p>{name}</p>
        <img src={image} alt='user' />
        <p>{statusText}</p>
      </li>
    ))}
  </ul>
);
export default UsersView;
